import React from 'react';
import './SolutionPage.css';

function LawFirms() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">Law Firms</h1>
      <div className="solution-desc">Rosie supports law firms by handling client inquiries, booking consultations, and providing after-hours support.</div>
      <div className="solution-section">
        <h2>Why Law Firms Use Rosie</h2>
        <ul>
          <li>Client intake and screening</li>
          <li>Consultation scheduling</li>
          <li>After-hours call handling</li>
        </ul>
      </div>
    </div>
  );
}

export default LawFirms;
